import React from "react";
import axios from "axios";

export default async function SearchTaskFunc(
  limitVal = 10,
  pageVal = 1,
  searchVal = ""
) {
  const linkApi =
    searchVal === ""
      ? `api/tasks?limit=${limitVal}&page=${pageVal}`
      : `api/tasks?limit=${limitVal}&page=${pageVal}&search=${searchVal}`;

  // TODO
  const res = await axios.get(linkApi);
  const data = await res.data

  return {data};
}
